import SignUp from "./SignUp";
import ProfilePage from "./ProfilePage";
import PasswordReset from "./PasswordReset";

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isLoggedIn: false,
    }
  }
  render() {
    if (this.state.isLoggedIn === true) {
      return (
        <div className="App">
          <h1>Equipe de ligne</h1>
          <ListeGare />
        </div>
      );
    } else {
      return <SignIn />
    }

  }
  componentDidMount() {
  }

}

export default App;
